export default function Content() {
  return (
    <React.Fragment>
      <CssBaseline />
      <Container fixed>
        <Box sx={{ bgcolor: '#cfe8fc', height: '100vh' }} />
        Number of Active User :
      </Container>
    </React.Fragment>
  );
}
